import React from "react";
import ReactDOM from "react-dom";
import add,{sub,multipy,division, multiply} from "./App";

ReactDOM.render(
  <>
    <ol>
      <li>add of two no is {add(0,2)}</li>
      <li>sub of two no is{sub(3,2)}</li>
      <li>mult of two no is {multiply(2,1)}</li>
      <li>division of two no is {division(2,2)}</li>
    </ol>
  </>
)
